                $('#' + loadedTree + ' td:nth-child(' + columnIndex + '),th:nth-child(' + columnIndex + ')').show();

            });

            //ocultar columnas de los checkboxes no checkeados.
            var unCheckedColumns = $(""input:checkbox:not(:checked)"").length;
